import './Section4.css';
import { Player } from 'video-react';
import Fleche_Bas from '../static/fleche_bas.svg';
import Fleche_Bas_Purple from '../static/fleche_bas_purple.svg';
import Logo_ReactNative from '../static/portfolio/reactnative/logo_reactnative.png';


const Section4 = () => {

    return(
        <div id="section4">
            <img className="down_arrow" alt="down arrow to go to resume" src={Fleche_Bas}  onClick={() => window.fullpage_api.moveSectionDown()}/>
            <img className="down_arrow da2" alt="down arrow to go to resume" src={Fleche_Bas_Purple}/>
            <h1 className="titre_sec3">Portfolio</h1>
            <h1 className="titre_sec3 ombre_sec3">Portfolio</h1>
            <div className="p_mainbloc">
                <div className="p_bloc1">
                    <h2>Redesign of MyVR, a React Native App created by ViaRezo, my school's network association.</h2>
                    <h3>An animation before/after is worth a thousand words</h3>
                {/* <Player
                playsInline
                // poster="/assets/poster.png"
                src="../static/portfolio/reactnative/video_myvr_old.mp4"
                className="video_old"
                /> */}
                <video width="750" height="500" >
                    <source src="../static/portfolio/reactnative/video_myvr_old.mp4" type="video/mp4" />
                </video>
                </div>
                <div className="p_bloc2">
                    <h2>Manager of the project for the update of the main website of Viarezo, viarezo.fr</h2>
                    <h3>Adding of the numerous companies partnerships with ViaRezo on the website</h3>
                    <h3>Modification of several design aspects</h3>
                    <h3>Management of the team, the calendar related to the project and the meetings.</h3>
                </div>
            </div>
        </div>
    );
}

export default Section4;
